import { BrowserRouter } from "react-router-dom"
import SignIn from "./component/SignIn"
import HomePage from "./component/HomePage"

const App = ()=>{
  return(
    <BrowserRouter>
    <header>
      <h1>Kasetsart</h1>
    </header>
      <HomePage/>
      <SignIn/>
      </BrowserRouter>

  );
}

export default App
